DROP TABLE IF EXISTS `fa_city`;
CREATE TABLE `fa_city`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `names` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '名称',
  `code` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '编码',
  `pinyin` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '拼音',
  `parent_id` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '上级ID',
  `level` tinyint(1) UNSIGNED NULL DEFAULT 0 COMMENT '级别:1=省,2=市,3=县',
  `status` tinyint(1) UNSIGNED NULL DEFAULT 1 COMMENT '状态:0=未启用,1=已启用',
  `create_time` int(10) UNSIGNED NULL DEFAULT NULL,
  `update_time` int(10) UNSIGNED NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `code`(`code`) USING BTREE COMMENT '地区编码唯一',
  INDEX `status_level`(`status`, `level`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3214 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '中国省市表（2020年6月中华人民共和国县以上行政区划代码）' ROW_FORMAT = Compact;

