  `school_type` tinyint(1) UNSIGNED NULL DEFAULT 0 COMMENT '办学层次:1=本科,2=专科',
  `school_mark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '备注',
